class ModifyOilTypeJsonSchema(GenerateJsonSchema):
    """Use this to modify the JSON schema for the OpenOilModelConfig.

    Doesn't hurt to use with any other model.

    Example
    -------

    >>> ptm.OpenDriftModel.model_json_schema(schema_generator=MyGenerateJsonSchema)
    """

    def generate(self, schema, mode="validation"):
        """Generate modified JSON schema for the OpenOilModelConfig."""
        schema = super().generate(schema, mode=mode)

        # List of enum values and corresponding titles
        enum_values = []
        for name, value in OilTypeEnum.__members__.items():
            enum_values.append(
                {
                    "const": value.id,  # The unique ID (enum name)
                    "title": value.title,  # The human-readable title which might be duplicated (enum value)
                }
            )

        # Modify the model schema to include the 'oneOf' list for the enum values
        schema["properties"]["oil_type"] = {
            "type": "string",
            "oneOf": enum_values,  # 'oneOf' will have the enum value with both 'const' and 'title'
        }

        return schema
